import React from "react";

class Social extends React.Component{
    render(){
        return (
          <div class="icons-social">
            <a href="https://github.com/steve-ryan">
              <i class="fab fa-github"></i>
            </a>
            <a  href="https://twitter.com/Stevewachirah">
              <i class="fab fa-twitter"></i>
            </a>
            <a  href="https://dev.to/steveryan">
              <i class="fab fa-dev"></i>
            </a>
            <a

              href="https://www.linkedin.com/in/steve-wachirah/"
            >
              <i class="fab fa-linkedin"></i>
            </a>
            <a  href="https://medium.com/@steveryan_50665">
              <i class="fab fa-medium"></i>
            </a>
            <a  href="https://codepen.io/Steve_ryan">
              <i class="fab fa-codepen"></i>
            </a>
          </div>
        );
    }
}

export default Social;
